import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const Dashboard = () => {
  const [message, setMessage] = useState('');
  const [clubs, setClubs] = useState([]);
  const [events, setEvents] = useState([]);
  const [resources, setResources] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (token) {
      // Fetch User-Specific Data (Clubs, Events, Resources)
      axios
        .get('http://localhost:8000/dashboard', {
          headers: { Authorization: `Bearer ${token}` },
        })
        .then((response) => {
          setMessage(response.data.message);

          // Fetch User Clubs
          axios.get('http://localhost:8000/clubs', {
            headers: { Authorization: `Bearer ${token}` },
          }).then((clubResponse) => {
            setClubs(clubResponse.data.clubs);
          }).catch((err) => {
            console.log(err);
          });

          // Fetch User Events
          axios.get('http://localhost:8000/events', {
            headers: { Authorization: `Bearer ${token}` },
          }).then((eventResponse) => {
            setEvents(eventResponse.data.events);
          }).catch((err) => {
            console.log(err);
          });

          // Fetch User Resources
          axios.get('http://localhost:8000/resources', {
            headers: { Authorization: `Bearer ${token}` },
          }).then((resourceResponse) => {
            setResources(resourceResponse.data.resources);
          }).catch((err) => {
            console.log(err);
          });

        })
        .catch(() => {
          setMessage('Access denied. Please log in.');
        });
    } else {
      setMessage('Access denied. Please log in.');
    }
  }, []);

  // Fetch all Clubs
  const fetchAllClubs = () => {
    const token = localStorage.getItem('token');
    if (token) {
      axios.get('http://localhost:8000/clubs/all', {
        headers: { Authorization: `Bearer ${token}` },
      }).then((response) => {
        setClubs(response.data.clubs);
      }).catch((err) => {
        console.log(err);
      });
    }
  };

  // Fetch all Events
  const fetchAllEvents = () => {
    const token = localStorage.getItem('token');
    if (token) {
      axios.get('http://localhost:8000/events/all', {
        headers: { Authorization: `Bearer ${token}` },
      }).then((response) => {
        setEvents(response.data.events);
      }).catch((err) => {
        console.log(err);
      });
    }
  };

  // Fetch all Resources
  const fetchAllResources = () => {
    const token = localStorage.getItem('token');
    if (token) {
      axios.get('http://localhost:8000/resources/all', {
        headers: { Authorization: `Bearer ${token}` },
      }).then((response) => {
        setResources(response.data.resources);
      }).catch((err) => {
        console.log(err);
      });
    }
  };

  // Handle Account Deletion
  const handleDeleteAccount = () => {
    const token = localStorage.getItem('token');
    if (token) {
      axios
        .delete('http://localhost:8000/delete-account', {
          headers: { Authorization: `Bearer ${token}` },
        })
        .then(() => {
          setMessage('Account deleted successfully. Redirecting to signup...');
          localStorage.removeItem('token');
          setTimeout(() => {
            navigate('/signup');
          }, 5000);
        })
        .catch(() => {
          setMessage('Error deleting account.');
        });
    }
  };

  // Handle Logout
  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/login');
  };

  return (
    <div>
      <h1>Dashboard</h1>
      <p>{message}</p>

      {/* Button to fetch all Clubs */}
      <button onClick={fetchAllClubs}>View All Clubs</button>
      
      {/* Button to fetch all Events */}
      <button onClick={fetchAllEvents}>View All Events</button>

      {/* Button to fetch all Resources */}
      <button onClick={fetchAllResources}>View All Resources</button>

      {/* Display Clubs */}
      <h2>All Clubs</h2>
      <ul>
        {clubs.map((club) => (
          <li key={club.club_id}>
            <strong>{club.club_name}</strong>
            <p>{club.description}</p>
          </li>
        ))}
      </ul>

      {/* Display Events */}
      <h2>All Events</h2>
      <ul>
        {events.map((event) => (
          <li key={event.event_id}>
            <strong>{event.event_name}</strong>
            <p>{event.event_description}</p>
            <p>Date: {new Date(event.event_date).toLocaleString()}</p>
            <p>Location: {event.location}</p>
          </li>
        ))}
      </ul>

      {/* Display Resources */}
      <h2>All Resources</h2>
      <ul>
        {resources.map((resource) => (
          <li key={resource.resource_id}>
            <strong>{resource.title}</strong>
            <p>Type: {resource.type}</p>
            <p>Uploaded on: {new Date(resource.upload_date).toLocaleString()}</p>
          </li>
        ))}
      </ul>

      {/* Actions */}
      <button onClick={handleDeleteAccount}>Delete Account</button>
      <button onClick={handleLogout}>Logout</button>
    </div>
  );
};

export default Dashboard;
